import React from 'react';

const ApplicationForm = () => {
  return (
    <div className="container">
      <div className="card">
        <h2>Application Form</h2>
        <p>This component will be implemented for submitting job applications.</p>
      </div>
    </div>
  );
};

export default ApplicationForm;
